B.P_=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten xB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite xB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite xB ist."]),t.i)
